import React from 'react'
import '../components/css/home.css'
import NavBar from '../components/navbar'

const Home = () => {
    return (
        <div className="home">
            <NavBar/>
            <a href="/login"> <button className="btn btn-light rounded-pill">LOGIN</button></a>
            
        </div>
    )
}

export default Home
